import "./signUp.css"
import React from 'react'

const SignUp = () => {
    return (
        <section className="showcase">
            <h2>SIGN UP</h2>
                <ul>
                <h2>First Name</h2>
                <h2>Last Name</h2>
                <h2>Date of Birth</h2>
                <h2>Email Address</h2>
                <h2>Social Media (@)</h2>
                <h2>Password</h2>
                <h2>Is Admin?</h2>
                </ul>
        </section>
    )
};

export default SignUp;
